using MGI.Common.Util;
using MGI.Cxn.Check.Certegy.Data;
using MGI.Cxn.Check.Contract;
using MGI.Cxn.Check.Data;
using NUnit.Framework;
using Spring.Data.Generic;
using Spring.Testing.NUnit;
using System;
using System.Collections.Generic;

namespace MGI.Cxn.Check.Certegy.Test
{
	[TestFixture]
	public class Certegy_Gateway_Fixture : AbstractTransactionalSpringContextTests
	{
		public MGIContext MgiContext { get; set; }
		protected override string[] ConfigLocations
		{
			get { return new string[] { "assembly://MGI.Cxn.Check.Certegy.Test/MGI.Cxn.Check.Certegy.Test/MGI.Cxn.Check.Certegy.Test.Spring.xml" }; }
		}

		public ICheckProcessor CxnCheckCertegyProcessor { get; set; }

		private MGIContext GetMGIContext()
		{
			MGIContext mgiContext = new MGIContext()
			{
				TimeZone = TimeZone.CurrentTimeZone.StandardName,
				ChannelPartnerId = 1,
				LocationName = "test",
				CertegySiteId = "1109541077350101",
				TerminalName = "MGI - Terminal"
			};
			return mgiContext;
		}

		#region Positive Register Test Cases

		[Test]
		public void Should_Register_Certegy_Account()
		{
			CheckAccount checkAccount = GetAccount();
			MgiContext = GetMGIContext();

			long accountId = CxnCheckCertegyProcessor.Register(checkAccount, MgiContext, MgiContext.TimeZone);

			Assert.That(accountId, Is.AtLeast(1000000000));
		}

		#endregion

		#region Negative Register Test Cases

		[ExpectedException("NHibernate.PropertyValueException")]
		[Test]
		public void Should_Not_Register_Certegy_Account_When_FirstName_Not_Available()
		{
			var checkAccount = new CheckAccount()
			{

				LastName = "PARKER",
				Address1 = "Test st",
				City = "SF",
				State = "CA",
				Zip = "12345",
				DateOfBirth = DateTime.Today.AddYears(-20),
				Phone = "4151234567",
				IDType = "PP"
			};
			MgiContext = GetMGIContext();
			CxnCheckCertegyProcessor.Register(checkAccount, MgiContext, MgiContext.TimeZone);

		}

		[ExpectedException("System.ArgumentException")]
		[Test]
		public void Should_Not_Register_Certegy_Account_When_Context_Parameter_Null()
		{
			CheckAccount checkAccount = GetAccount();
			MgiContext = GetMGIContext();

			CxnCheckCertegyProcessor.Register(checkAccount, MgiContext, MgiContext.TimeZone);
		}

		#endregion

		#region Positive Submit Test Cases

		[Test]
		public void Can_Submit_Check()
		{
			CheckAccount checkAccount = GetAccount();
			CheckInfo check = CreateCheck(100m);
			long transactionId = 123123123;
			MgiContext = GetMGIContext();
			long accountId = CxnCheckCertegyProcessor.Register(checkAccount, MgiContext, MgiContext.TimeZone);
			CheckStatus status = CxnCheckCertegyProcessor.Submit(transactionId, accountId, check, MgiContext);
			Assert.IsTrue(status != CheckStatus.Unknown);

		}

		#endregion

		#region Negative Submit Test Cases

		[ExpectedException(typeof(CheckException))]
		[Test]
		public void Should_Not_Submit_When_Account_Number_Not_Valid()
		{
			CheckAccount checkAccount = GetAccount();
			CheckInfo check = CreateCheck(100m);
			MgiContext = GetMGIContext();
			long transactionId = 123123123;

			CheckStatus status = CxnCheckCertegyProcessor.Submit(transactionId, 99999999, check, MgiContext);

		}

		[ExpectedException(typeof(ArgumentException))]
		[Test]
		public void Should_Not_Submit_When_Check_Info_Parameter_Is_Null()
		{
			CheckAccount checkAccount = GetAccount();
			CheckInfo check = null;
			MgiContext = GetMGIContext();
			long transactionId = 123123123;

			CheckStatus status = CxnCheckCertegyProcessor.Submit(transactionId, 99999999, check, MgiContext);

		}

		[ExpectedException(typeof(ArgumentException))]
		[Test]
		public void Should_Not_Submit_When_Context_Parameter_Is_Null()
		{
			CheckAccount checkAccount = GetAccount();
			CheckInfo check = CreateCheck(100m);
			MgiContext = GetMGIContext();
			long transactionId = 123123123;

			CheckStatus status = CxnCheckCertegyProcessor.Submit(transactionId, 99999999, check, MgiContext);

		}

		[ExpectedException(typeof(ArgumentException))]
		[Test]
		public void Should_Not_Submit_When_TimeZone_Unavailable_In_Context_Parameter()
		{
			CheckAccount checkAccount = GetAccount();
			CheckInfo check = CreateCheck(100m);
			MgiContext = GetMGIContext();
			long transactionId = 123123123;

			CheckStatus status = CxnCheckCertegyProcessor.Submit(transactionId, 100002045, check, MgiContext);

		}

		[ExpectedException(typeof(ArgumentException))]
		[Test]
		public void Should_Not_Submit_When_TerminalName_Unavailable_In_Context_Parameter()
		{
			CheckAccount checkAccount = GetAccount();
			CheckInfo check = CreateCheck(100m);
			Dictionary<string, object> context = new Dictionary<string, object>() 
			{				
                 {"ChannelPartnerId", 34}
			};
			long transactionId = 123123123;

			CheckStatus status = CxnCheckCertegyProcessor.Submit(transactionId, 100002045, check, MgiContext);

		}

		[ExpectedException(typeof(ArgumentException))]
		[Test]
		public void Should_Not_Submit_When_ChannelPartnerId_Unavailable_In_Context_Parameter()
		{
			CheckAccount checkAccount = GetAccount();
			CheckInfo check = CreateCheck(100m);
			MgiContext = GetMGIContext();
			long transactionId = 123123123;

			CheckStatus status = CxnCheckCertegyProcessor.Submit(transactionId, 100002045, check, MgiContext);

		}
		#endregion

		#region Positive Commit Test Cases

		[Test]
		public void Can_Commit()
		{
			CheckAccount checkAccount = GetAccount();
			CheckInfo check = CreateCheck(100m);
			MgiContext = GetMGIContext();
			long transactionId = 123123123;

			long accountId = CxnCheckCertegyProcessor.Register(checkAccount, MgiContext, MgiContext.TimeZone);
			CheckStatus status = CxnCheckCertegyProcessor.Submit(transactionId, accountId, check, MgiContext);

			CxnCheckCertegyProcessor.Commit(transactionId, "Eastern Standard Time", MgiContext);

		}

		#endregion

		#region Negative Commit Test Cases

		[ExpectedException(typeof(ArgumentException))]
		[Test]
		public void Should_Not_Commit_When_timezone_Parameter_Is_Null()
		{
			CheckAccount checkAccount = GetAccount();
			MgiContext = GetMGIContext();
			CxnCheckCertegyProcessor.Commit(1000000034, "Eastern Standard Time", MgiContext);

		}

		#endregion

		#region Positive Check Reverse Test Cases

		[Test]
		public void Can_Reverse_Check()
		{
			CheckAccount checkAccount = GetAccount();
			CheckInfo check = CreateCheck(100m);
			MgiContext = GetMGIContext();
			long transactionId = 123123123;

			long accountId = CxnCheckCertegyProcessor.Register(checkAccount, MgiContext, MgiContext.TimeZone);
			CheckStatus status = CxnCheckCertegyProcessor.Submit(transactionId, accountId, check, MgiContext);

			CxnCheckCertegyProcessor.Cancel(transactionId, MgiContext.TimeZone, MgiContext);
		}

		#endregion

		#region Negative Check Reverse Test Cases

		[ExpectedException(typeof(CheckException))]
		[Test]
		public void Should_Not_Reverse_When_Transaction_Id_Parameter_Not_Valid()
		{
			
			CheckInfo check = CreateCheck(100m);
			MgiContext = GetMGIContext();
			long transactionId = 123123123;

			CxnCheckCertegyProcessor.Cancel(transactionId, MgiContext.TimeZone, MgiContext);

		}

		[ExpectedException(typeof(CheckException))]
		[Test]
		public void Should_Not_Reverse_When_Check_Micr_Not_Available()
		{
			CheckAccount checkAccount = GetAccount();
			CheckInfo check = CreateCheck(100m);
			check.Micr = "";
			MgiContext = GetMGIContext();
			long transactionId = 123123123;

			long accountId = CxnCheckCertegyProcessor.Register(checkAccount, MgiContext, MgiContext.TimeZone);
			CheckStatus status = CxnCheckCertegyProcessor.Submit(transactionId, accountId, check, MgiContext);
			CxnCheckCertegyProcessor.Cancel(transactionId, MgiContext.TimeZone, MgiContext);

		}

		#endregion

		#region Private Methods

		private static CheckAccount GetAccount()
		{
			var checkAccount = new CheckAccount()
			{				
				FirstName = "JOHN",
				LastName = "PARKER",
				Address1 = "Test st",
				City = "SF",
				State = "CA",
				Zip = "12345",
				DateOfBirth = DateTime.Today.AddYears(-20),
				Phone = "4151234567",
				IDType = "DRIVER'S LICENSE",
				IDState = "CA"
			};
			return checkAccount;
		}

		private CheckInfo CreateCheck(decimal amount)
		{
			return new CheckInfo
			{
				Amount = amount,
				Latitude = 0,
				Longitude = 0,
				Micr = "fjdkafjdkslfajk",
				FrontImage = Convert.FromBase64String(""),
				BackImage = Convert.FromBase64String(""),
				FrontImageTIF = Convert.FromBase64String(""),
				BackImageTIF = Convert.FromBase64String(""),
				ImageFormat = "jpg",
				IssueDate = DateTime.Today,
				Type = Check.Data.CheckType.Cashier
			};
		}
		#endregion
	}
}
